import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';
import { FaGoogle } from 'react-icons/fa';
import './LoginPage.css';
import Header from './Header';

export default function LoginPage() {
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
    const [loading, setLoading] = useState(false);
    const { login, loginWithGoogle, error: authError } = useAuth();
    const navigate = useNavigate();

    async function handleSubmit(e) {
        e.preventDefault();
        try {
            setLoading(true);
            await login(email, password);
            navigate('/');
        } catch (error) {
            console.error('Error en login:', error);
        } finally {
            setLoading(false);
        }
    }

    async function handleGoogleLogin() {
        try {
            setLoading(true);
            await loginWithGoogle();
            navigate('/');
        } catch (error) {
            console.error('Error en login con Google:', error);
        } finally {
            setLoading(false);
        }
    }

    return (
        <div className="min-h-screen bg-black text-white">
            <div className="max-w-md mx-auto p-4">
                <div className="bg-gray-800 rounded-xl p-6 shadow-lg">
                    <div className="text-center mb-6">
                        <img 
                            src="/logo.png" 
                            alt="Semental Fit Logo" 
                            className="w-32 h-32 mx-auto mb-4"
                        />
                        <h2 className="text-2xl font-bold text-yellow-400">Iniciar Sesión</h2>
                    </div>

                    {authError && (
                        <div className="bg-red-500 text-white p-3 rounded mb-4 text-sm">
                            {authError}
                        </div>
                    )}

                    <form onSubmit={handleSubmit} className="space-y-4">
                        <div>
                            <label htmlFor="email" className="block text-sm font-medium text-gray-300 mb-1">
                                Correo Electrónico
                            </label>
                            <input
                                type="email"
                                id="email"
                                value={email}
                                onChange={(e) => setEmail(e.target.value)}
                                required
                                disabled={loading}
                                className="w-full px-3 py-2 bg-gray-700 border border-gray-600 rounded text-white focus:outline-none focus:border-yellow-500"
                            />
                        </div>
                        <div>
                            <label htmlFor="password" className="block text-sm font-medium text-gray-300 mb-1">
                                Contraseña
                            </label>
                            <input
                                type="password"
                                id="password"
                                value={password}
                                onChange={(e) => setPassword(e.target.value)}
                                required
                                disabled={loading}
                                className="w-full px-3 py-2 bg-gray-700 border border-gray-600 rounded text-white focus:outline-none focus:border-yellow-500"
                            />
                        </div>
                        <button 
                            type="submit" 
                            disabled={loading}
                            className="w-full py-2 bg-yellow-500 text-black font-semibold rounded hover:bg-yellow-400 disabled:opacity-50"
                        >
                            {loading ? 'Iniciando sesión...' : 'Iniciar Sesión'}
                        </button>
                    </form>

                    <div className="relative my-6">
                        <div className="absolute inset-0 flex items-center">
                            <div className="w-full border-t border-gray-600"></div>
                        </div>
                        <div className="relative flex justify-center text-sm">
                            <span className="px-2 bg-gray-800 text-gray-400">o</span>
                        </div>
                    </div>

                    <button 
                        onClick={handleGoogleLogin}
                        disabled={loading}
                        className="w-full py-2 bg-gray-700 text-white font-semibold rounded hover:bg-gray-600 disabled:opacity-50 flex items-center justify-center gap-2"
                    >
                        <FaGoogle className="text-yellow-400" />
                        Continuar con Google
                    </button>

                    <div className="mt-6 text-center text-sm text-gray-400">
                        ¿No tienes una cuenta?{' '}
                        <Link to="/register" className="text-yellow-400 hover:text-yellow-300">
                            Regístrate aquí
                        </Link>
                    </div>
                </div>
            </div>
        </div>
    );
}
